import React from 'react'
import { StyleSheet, Text, View } from 'react-native';

function NewsDetail() {
  return (
    <View>
        <Text>
            This is NewsDetail page
        </Text>
        <Text>
          WIll have some extra detail too...
        </Text>
    </View>
  )
}

export default NewsDetail
